import React from "react";
import Home from "./components/Home";
import Box from "./components/Three";
import { Canvas } from "react-three-fiber";

function App() {
  return (
    <div className="App">
      <Home />
      <Canvas>
        <ambientLight />
        <pointLight position={[10, 10, 10]} />
        <Box position={[-1.2, 0, 0]} />
        <Box position={[1.2, 0, 0]} />
        <Box />
      </Canvas>
    </div>
  );
}

export default App;
